window.bookSummaryJSON = "<p><b>After the untimely death of his father, Rosier \"Zoo\" Boudreaux rightfully inherits Boudreaux Enterprises.</b></p> <p>Although he anticipated being in charge his entire life, he could have never prepared for the dark secrets, dirty money, and unethical practices that lived after his father's demise. Though thrown for a loop, he wastes no time claiming his seat at the head of the table and demanding the respect of his constituents. After all, Zoo was trained for it.</p> <p>In an attempt to right his father's transgressions, he amasses a number of enemies who feel he's disrupted the flow of business. And if a war between families isn't enough, at the center of this conflict lies a beautiful, timid yet elegant layer that threatens to change the course of everyone's lives.</p> <p>Zoo quickly shows the nonbelievers why his father appointed him as the heir to the business. Trust that no one wants to cross the ruthless one.</p>"; 
